import React from "react"

function Roaster(){
    return (
        <div className="bg-yellow-700 pb-4">
            <h1 className="capitalize font-semibold font-serif pt-2 px-4 text-3xl text-center text-white">Beans are prepared <span className="font-bold text-yellow-300">in house</span> for amazing results</h1>
            <img className="my-5 w-full h-auto" src="https://images.unsplash.com/photo-1511537190424-bbbab87ac5eb?ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=1470&q=80" alt="coffee roaster" />
            <div className="bg-yellow-800 w-2/3 mx-auto rounded-2xl">
                <h1 className="text-center p-2 text-3xl text-white">This is where the magic happens!</h1>
            </div>
        </div>
    );
}

export default Roaster;
